export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},xWzvBMqWjU:{data:{id:1653,attributes:{imdbId:"tt1228705",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTM0MDgwNjMyMl5BMl5BanBnXkFtZTcwNTg3NzAzMw@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"72%"},{Source:"Metacritic",Value:"57\u002F100"}],item_lang:{data:{id:2316,attributes:{title:"Iron Man 2",plot:"With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press, and the public to share his technology with the military. Unwilling to let go of his invention, Stark, along with Pepper Potts, and James \"Rhodey\" Rhodes at his side, must forge new alliances - and confront powerful enemies.",slug:"iron-man-2"}}},books:{data:[{id:8556,attributes:{title:"Stan Lee's How to Write Comics",description:"Comics icon Stan Lee, creator of the Mighty Marvel Universe, has set about to teach everything he knows about writing and creating comic book characters. In these pages, aspiring comics writers will learn everything they need to know about how to write their own comic book stories, complete with easy to understand instruction, tips of the trade, and invaluable advice even for more advance writers. From the secrets to creating concepts, plots, to writing the script, the man with no peer — Stan Lee—is your guide to the world of writing and creating comics.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OB3coAfXoWoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2011-10-11",publisher:d,subtitle:"From the Legendary Co-Creator of Spider-Man, the Incredible Hulk, Fantastic Four, X-Men, and Iron Man"}},{id:8557,attributes:{title:"Stan Lee's How to Draw Comics",description:"In Stan Lee's How to Draw Comics, Stan Lee reveals his secrets for: * Costumes * Penciling, Inking & Coloring * Lettering & Word Balloons * Digital Advances * Perspective & Foreshortening * What Makes Great Action * Page & Panel Layout * Covers * Creating a Portfolio * Getting Work When it comes to comic books, one name says it all: Stan Lee. His characters are classics. His industry knowledge is vast. His creativity is boundless. And now, he’s sharing what he knows with you, Grasshopper! His cohorts have always been—and still are—some of the best in the business: Jack Kirby, John Romita, Sr., Neal Adams, Gil Kane, Mike Deodato, Jr., Frank Cho, and Jonathan Lau, and many others, Stan includes their work here and discusses what exactly makes it so great. He touches on all the important stuff: anatomy, foreshortening, perspective, action, penciling, inking, hand lettering vs. digital lettering, color, character and costume design, panel flow, materials and tools, computers, file formats, and software. He includes an overview of the history and development of the comic book industry, and there’s an extensive section on various types of covers—the super important element that makes the reader want to pick up that comic! In a world where good battles evil at every turn and the hero fights valiantly to get the girl, no stone is left unturned! Here you’ll also find info on all the small details—that really aren’t so small: word balloons, thought balloons, whisper balloons, bursts, sound effect lettering, and splash pages! And KA-BLAMMM! . . . once you’ve created your art, then what? Lest you think Stan would turn you out into the wilderness without a road map, fellow traveler, there’s also information on preparing and submitting your portfolio, on getting work, and on suggested reading and schools. Stan Lee’s How to Draw Comics features a cover that reunites long time collaborator John Romita Sr. and original cover artist of How to Draw Comics the Marvel Way. John Romita Sr. was most famous for his collaboration on The Amazing Spider-Man with Stan Lee! It’s time for a new approach . . . “a cornucopia of cutting-edge, techno-savvy instructions to lead you down the freshly laid yellow brick road of creativity.” It’s time for a book that takes you on the new journey of creating comic books for the 21st century and beyond! Excelsior!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xOMr_k0z-wMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2011-10-12",publisher:d,subtitle:"From the Legendary Creator of Spider-Man, The Incredible Hulk, Fantastic Four, X -Men, and Iron Man"}},{id:8558,attributes:{title:"Iron Man",description:"Marvel's next big blockbuster, Iron Man, is to hit the cinemas in May 2008, this classic collection includes the origins of Iron Man's superheroic career by the world's most famous comic creative team of Stan Lee, Jack Kirby and Steve Ditko. Iron Man is a super hero with a difference: he is without any natural super powers. Billionaire industrialist Tony Stark relies instead on his ultra high-tec armour to confront dangers to humanity.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r_tlLAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Don Heck"],firstBook:c,published:"2008-01-01",publisher:"",subtitle:"1963-64"}},{id:8559,attributes:{title:"Stan Lee's How to Draw Superheroes",description:"The third installment in comics icon Stan Lee's series showing readers how to draw some of the most exciting and dynamic superheroes of all time. Spider-Man, the X-Men, the Fantastic Four, Iron Man, the Incredible Hulk, and the Avengers all share a common trait -- these hugely popular Marvel Comics superheroes were co-created by the legendary Stan Lee. Now, Lee shows readers everything they'll need to make their own mighty superheroes, just like his classic creations. Lee exposes his secret tools and techniques for bringing strong, inspiring heroes and heroines to life. He even shows aspiring creators how to expand their super-universes with evil villains, trusty sidekicks, brutes and monsters, super-pets, secret hideouts, and more! These invaluable insights from one of the greatest superhero creators of all time are must-haves for all fans of Lee's legendary superhero comic work.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=d5CV00S1E_cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2013-07-09",publisher:d,subtitle:"From the Legendary Co-creator of the Avengers, Spider-Man, the Incredible Hulk, the Fantastic Four, the X-Men, and Iron Man"}},{id:8560,attributes:{title:"Excelsior!",description:"In a remarkable autobiography, the creator of Marvel Comics describes his youth in the Bronx, his early years publishing comic books during World War II, the rise of the Marvel empire, and his creation of such legendary superheroes as the X-Men, Spider Man, the Incredible Hulk, and other popular icons. Simultaneous.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NZytPoMbVioC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,"George Mair"],firstBook:c,published:"2002-05-28",publisher:"Simon and Schuster",subtitle:"The Amazing Life of Stan Lee"}}]}}},meta:{}}},prerenderedAt:1681377313249}}("Stan Lee","movie",null,"Watson-Guptill","series",1))